import React from "react";
import axios from "axios";

const Scores = () => {
  // Create state variables
  let [scoresData, setScoresData] = React.useState({
    method: "GET",
    url: "https://sportspage-feeds.p.rapidapi.com/games",
    headers: {
      "x-rapidapi-key": "eb45bf77dfmshf915d7ada5b551ep155d70jsn029abbe4cef7",
      "x-rapidapi-host": "sportspage-feeds.p.rapidapi.com",
    },
  });
  // fetches data
  const fetchData = (e) => {
    e.preventDefault();
    axios
      .request()
      .then((response) => {
        setResponseData(response.data);
        console.log(response);
      })
      .catch((error) => {
        console.log(error);
      });
  };
  return (
    <div>
      <h1>{scoresData.title}</h1>
      <button onClick={(e) => setScoresData(e)} type="button">
        Click Me For Data
      </button>
      {scoresData.dates &&
        scoresData.dates.map((date) => {
          return <p>{date}</p>;
        })}
    </div>
  );
};
export default IndexPage;
